public class ProxyingHandlerMethodArgumentResolver extends org.springframework.web.method.annotation.ModelAttributeMethodProcessor implements org.springframework.beans.factory.BeanClassLoaderAware , org.springframework.beans.factory.BeanFactoryAware , org.springframework.context.ResourceLoaderAware {
    private static final java.util.List<java.lang.String> IGNORED_PACKAGES = java.util.Arrays.asList("java", "org.springframework");

    private final org.springframework.data.projection.SpelAwareProxyProjectionFactory proxyFactory;

    private final org.springframework.core.convert.ConversionService conversionService;

    public ProxyingHandlerMethodArgumentResolver(org.springframework.core.convert.ConversionService conversionService) {
        super(true);
        this.proxyFactory = new org.springframework.data.projection.SpelAwareProxyProjectionFactory();
        this.conversionService = conversionService;
    }

    @java.lang.Override
    public void setBeanFactory(org.springframework.beans.factory.BeanFactory beanFactory) throws org.springframework.beans.BeansException {
        this.proxyFactory.setBeanFactory(beanFactory);
    }

    @java.lang.Override
    @java.lang.Deprecated
    public void setResourceLoader(org.springframework.core.io.ResourceLoader resourceLoader) {
        this.proxyFactory.setResourceLoader(resourceLoader);
    }

    @java.lang.Override
    public void setBeanClassLoader(java.lang.ClassLoader classLoader) {
        this.proxyFactory.setBeanClassLoader(classLoader);
    }

    @java.lang.Override
    public boolean supportsParameter(org.springframework.core.MethodParameter parameter) {
        java.lang.Class<?> type = parameter.getParameterType();
        if (!type.isInterface()) {
            return false;
        }
        if (parameter.getParameterAnnotation(org.springframework.data.web.ProjectedPayload.class) != null) {
            return true;
        }
        if (org.springframework.core.annotation.AnnotatedElementUtils.findMergedAnnotation(type, org.springframework.data.web.ProjectedPayload.class) != null) {
            return true;
        }
        for (java.lang.String prefix : org.springframework.data.web.ProxyingHandlerMethodArgumentResolver.IGNORED_PACKAGES) {
            if (org.springframework.util.ClassUtils.getPackageName(type).startsWith(prefix)) {
                return false;
            }
        }
        return true;
    }

    @java.lang.Override
    protected java.lang.Object createAttribute(java.lang.String attributeName, org.springframework.core.MethodParameter parameter, org.springframework.web.bind.support.WebDataBinderFactory binderFactory, org.springframework.web.context.request.NativeWebRequest request) throws java.lang.Exception {
        org.springframework.data.web.MapDataBinder binder = new org.springframework.data.web.MapDataBinder(parameter.getParameterType(), conversionService);
        binder.bind(new org.springframework.beans.MutablePropertyValues(request.getParameterMap()));
        return proxyFactory.createProjection(parameter.getParameterType(), binder.getTarget());
    }

    @java.lang.Override
    protected void bindRequestParameters(org.springframework.web.bind.WebDataBinder binder, org.springframework.web.context.request.NativeWebRequest request) {
    }
}

